import React from "react";

function Login(){


    function logout(){
        sessionStorage.removeItem('id');
        // document.
    }

    return (
        <div>
            <h1>{sessionStorage.getItem('id')} login success</h1>
            <div>
                <button onClick={logout}>로그아웃</button>
            </div>
        </div>
    );
}

export default Login
